import React, { Component } from "react";
import Wrapper from "../Wrapper";
import axios from "axios";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import Chip from "@material-ui/core/Chip";
import Grid from "@material-ui/core/Grid";
import Checkbox from "@material-ui/core/Checkbox";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import DateFnsUtils from "@date-io/date-fns";
import {
  MuiPickersUtilsProvider,
  KeyboardTimePicker,
  KeyboardDatePicker,
} from "@material-ui/pickers";

class Raports extends Component {
  constructor(props) {
    super(props);
    this.state = {
      tickets: [],
      checkedCreatedate: false,
      checkedDeliverydate: false,
      checkedAccepteddate: false,
      checkedPaymentdate: false,
      selectedFromCreatedDate: null,
      selectedToCreatedDate: null,
      selectedFromDeliveryDate: null,
      selectedToDeliveryDate: null,
      selectedFromAcceptedDate: null,
      selectedToAcceptedDate: null,
      selectedFromPaymentDate: null,
      selectedToPaymentDate: null,
      selectedDate: null,
      cargoStates:[]
    };
    this.handleChange = this.handleChange.bind(this);
  }
  getCargoStates(){
    axios
    .get("/cargoState")
    .then((response) => {
      console.log(response);
      this.setState({ cargoStates: response.data });
    })
    .catch((error) => {
      console.log(error);
    });
};

  componentDidMount() {
    this.getCargoStates();
    axios
      .get("/ticket")
      .then((response) => {
        console.log(response.data);
        this.setState({ tickets: response.data });
      })
      .catch((error) => {
        console.log(error);
      });
  }
  handleChange = (event) => {
    this.setState({ ...this.state, [event.target.name]: event.target.checked });
  };
  handleCreatedFromDateChange = (date) => {
    this.setState({
      selectedFromCreatedDate: date,
    });
  };
  handleCreatedToDateChange = (date) => {
    this.setState({
      selectedToCreatedDate: date,
    });
  };
  handleDeliveryFromDateChange = (date) => {
    this.setState({
      selectedFromDeliveryDate: date,
    });
  };
  handleDeliveryToDateChange = (date) => {
    this.setState({
      selectedToDeliveryDate: date,
    });
  };
  handleAcceptedFromDateChange = (date) => {
    this.setState({
      selectedFromAcceptedDate: date,
    });
  };
  handleAcceptedToDateChange = (date) => {
    this.setState({
      selectedToAcceptedDate: date,
    });
  };
  handlePaymentFromDateChange = (date) => {
    this.setState({
      selectedFromPaymentDate: date,
    });
  };
  handlePaymentToDateChange = (date) => {
    this.setState({
      selectedToPaymentDate: date,
    });
  };
  render() {
    const {
      tickets,
      checkedCreatedate,
      checkedDeliverydate,
      checkedAccepteddate,
      checkedPaymentdate,
      selectedFromCreatedDate,
      selectedToCreatedDate,
      selectedFromDeliveryDate,
      selectedToDeliveryDate,
      selectedFromAcceptedDate,
      selectedToAcceptedDate,
      selectedFromPaymentDate,
      selectedToPaymentDate,
      selectedDate,
      cargoStates
    } = this.state;
    return (
      <Wrapper>
        <div>
          <Grid container spacing={3}>
            <Grid item xs={6} sm={6}>
              <Select
                labelId="demo-simple-select-label"
                id="demo-simple-select"
                value={status}
                onChange={this.handleStatusChange}
                style={{ width: "100%", marginTop: "40px" }}
              >
                {cargoStates.map((state) => (
                  <MenuItem key={state.id} value={state}>
                    {state.description}
                  </MenuItem>
                ))}
              </Select>
            </Grid>
          </Grid>

          <Grid container spacing={3}>
            <Grid item xs={12} sm={2}>
              <FormControlLabel
                style={{ paddingTop: "30px" }}
                control={
                  <Checkbox
                    checked={checkedCreatedate}
                    onChange={this.handleChange}
                    name="checkedCreatedate"
                    color="primary"
                  />
                }
                label="Data krijimit"
              />
            </Grid>
            <Grid item xs={6} sm={2}>
              <MuiPickersUtilsProvider utils={DateFnsUtils}>
                <KeyboardDatePicker
                  disableToolbar
                  variant="inline"
                  format="MM/dd/yyyy"
                  margin="normal"
                  id="date-picker-inline"
                  label="Nga data"
                  value={selectedFromCreatedDate}
                  onChange={this.handleCreatedFromDateChange}
                  KeyboardButtonProps={{
                    "aria-label": "change date",
                  }}
                />
              </MuiPickersUtilsProvider>
            </Grid>
            <Grid item xs={6} sm={2}>
              <MuiPickersUtilsProvider utils={DateFnsUtils}>
                <KeyboardDatePicker
                  disableToolbar
                  variant="inline"
                  format="MM/dd/yyyy"
                  margin="normal"
                  id="date-picker-inline"
                  label="Deri ne daten"
                  value={selectedToCreatedDate}
                  onChange={this.handleCreatedToDateChange}
                  KeyboardButtonProps={{
                    "aria-label": "change date",
                  }}
                />
              </MuiPickersUtilsProvider>
            </Grid>

            <Grid item xs={12} sm={2}>
              <FormControlLabel
                style={{ paddingTop: "30px" }}
                control={
                  <Checkbox
                    checked={checkedDeliverydate}
                    onChange={this.handleChange}
                    name="checkedDeliverydate"
                    color="primary"
                  />
                }
                label="Data e dorezimit"
              />
            </Grid>
            <Grid item xs={6} sm={2}>
              <MuiPickersUtilsProvider utils={DateFnsUtils}>
                <KeyboardDatePicker
                  disableToolbar
                  variant="inline"
                  format="MM/dd/yyyy"
                  margin="normal"
                  id="date-picker-inline"
                  label="Nga data"
                  value={selectedFromDeliveryDate}
                  onChange={this.handleDeliveryFromDateChange}
                  KeyboardButtonProps={{
                    "aria-label": "change date",
                  }}
                />
              </MuiPickersUtilsProvider>
            </Grid>

            <Grid item xs={6} sm={2}>
              <MuiPickersUtilsProvider utils={DateFnsUtils}>
                <KeyboardDatePicker
                  disableToolbar
                  variant="inline"
                  format="MM/dd/yyyy"
                  margin="normal"
                  id="date-picker-inline"
                  label="Deri ne daten"
                  value={selectedToDeliveryDate}
                  onChange={this.handleDeliveryToDateChange}
                  KeyboardButtonProps={{
                    "aria-label": "change date",
                  }}
                />
              </MuiPickersUtilsProvider>
            </Grid>
          </Grid>

          <Grid container spacing={3}>
            <Grid item xs={12} sm={2}>
              <FormControlLabel
                style={{ paddingTop: "30px" }}
                control={
                  <Checkbox
                    checked={checkedAccepteddate}
                    onChange={this.handleChange}
                    name="checkedAccepteddate"
                    color="primary"
                  />
                }
                label="Data e pranimit"
              />
            </Grid>
            <Grid item xs={6} sm={2}>
              <MuiPickersUtilsProvider utils={DateFnsUtils}>
                <KeyboardDatePicker
                  disableToolbar
                  variant="inline"
                  format="MM/dd/yyyy"
                  margin="normal"
                  id="date-picker-inline"
                  label="Nga data"
                  value={selectedFromAcceptedDate}
                  onChange={this.handleAcceptedFromDateChange}
                  KeyboardButtonProps={{
                    "aria-label": "change date",
                  }}
                />
              </MuiPickersUtilsProvider>
            </Grid>

            <Grid item xs={6} sm={2}>
              <MuiPickersUtilsProvider utils={DateFnsUtils}>
                <KeyboardDatePicker
                  disableToolbar
                  variant="inline"
                  format="MM/dd/yyyy"
                  margin="normal"
                  id="date-picker-inline"
                  label="Deri ne daten"
                  value={selectedToAcceptedDate}
                  onChange={this.handleAcceptedToDateChange}
                  KeyboardButtonProps={{
                    "aria-label": "change date",
                  }}
                />
              </MuiPickersUtilsProvider>
            </Grid>

            <Grid item xs={12} sm={2}>
              <FormControlLabel
                style={{ paddingTop: "30px" }}
                control={
                  <Checkbox
                    checked={checkedPaymentdate}
                    onChange={this.handleChange}
                    name="checkedPaymentdate"
                    color="primary"
                  />
                }
                label="Data e pageses"
              />
            </Grid>
            <Grid item xs={6} sm={2}>
              <MuiPickersUtilsProvider utils={DateFnsUtils}>
                <KeyboardDatePicker
                  disableToolbar
                  variant="inline"
                  format="MM/dd/yyyy"
                  margin="normal"
                  id="date-picker-inline"
                  label="Nga data"
                  value={selectedFromPaymentDate}
                  onChange={this.handlePaymentFromDateChange}
                  KeyboardButtonProps={{
                    "aria-label": "change date",
                  }}
                />
              </MuiPickersUtilsProvider>
            </Grid>

            <Grid item xs={6} sm={2}>
              <MuiPickersUtilsProvider utils={DateFnsUtils}>
                <KeyboardDatePicker
                  disableToolbar
                  variant="inline"
                  format="MM/dd/yyyy"
                  margin="normal"
                  id="date-picker-inline"
                  label="Deri ne daten"
                  value={selectedToPaymentDate}
                  onChange={this.handlePaymentToDateChange}
                  KeyboardButtonProps={{
                    "aria-label": "change date",
                  }}
                />
              </MuiPickersUtilsProvider>
            </Grid>
          </Grid>
        </div>

        <div>
          <TableContainer component={Paper} style={{ marginTop: "40px" }}>
            <Table aria-label="simple table">
              <TableHead>
                <TableRow>
                  <TableCell>Date</TableCell>
                  <TableCell>NO</TableCell>
                  <TableCell>State</TableCell>
                  <TableCell align="right">First name</TableCell>
                  <TableCell align="right">Last name</TableCell>
                  <TableCell align="right">Mobile</TableCell>
                  <TableCell align="right">Comment</TableCell>
                  <TableCell align="right">Address</TableCell>
                  <TableCell align="right">City</TableCell>
                  <TableCell align="right">State</TableCell>
                  <TableCell align="right">Price</TableCell>
                  <TableCell align="right">Curreny</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {tickets?.length
                  ? tickets.map((ticket) => (
                      <TableRow
                        key={ticket.id}
                        onClick={() => this.handleClickOpen(ticket)}
                        style={{ cursor: "pointer" }}
                      >
                        <TableCell component="th" scope="row">
                          {new Date(ticket.date).toLocaleDateString("en-US")}{" "}
                          {new Date(ticket.date).toLocaleTimeString("en-US")}
                        </TableCell>
                        <TableCell align="right">{ticket.no}</TableCell>
                        <TableCell
                          align="right"
                          onClick={(e) => {
                            this.changeStatus(e, ticket);
                          }}
                        >
                          {" "}
                          <Chip
                            label={
                              ticket.ticketProgress[
                                ticket.ticketProgress.length - 1
                              ].cargoState.description
                            }
                            variant="default"
                            style={{
                              backgroundColor:
                                ticket.ticketProgress[
                                  ticket.ticketProgress.length - 1
                                ].cargoState.state === "CREATED"
                                  ? "#c0bdc1e3"
                                  : ticket.ticketProgress[
                                      ticket.ticketProgress.length - 1
                                    ].cargoState.state === "STORED"
                                  ? "#ff7100"
                                  : ticket.ticketProgress[
                                      ticket.ticketProgress.length - 1
                                    ].cargoState.state === "DISTRIBUTING"
                                  ? "#4959bf"
                                  : ticket.ticketProgress[
                                      ticket.ticketProgress.length - 1
                                    ].cargoState.state === "DELIVERED"
                                  ? "#00bf40"
                                  : ticket.ticketProgress[
                                      ticket.ticketProgress.length - 1
                                    ].cargoState.state === "REJECTED"
                                  ? "#ff2424"
                                  : "",
                            }}
                          />
                        </TableCell>
                        <TableCell align="right">{ticket.firstName}</TableCell>
                        <TableCell align="right">{ticket.lastName}</TableCell>
                        <TableCell align="right">{ticket.mobile}</TableCell>
                        <TableCell align="right">{ticket.comment}</TableCell>
                        <TableCell align="right">{ticket.address}</TableCell>
                        <TableCell align="right">{ticket.city.city}</TableCell>
                        <TableCell align="right">{ticket.state}</TableCell>
                        <TableCell align="right">{ticket.price}</TableCell>
                        <TableCell align="right">
                          {ticket.currency.currency}
                        </TableCell>
                      </TableRow>
                    ))
                  : "No data"}
              </TableBody>
            </Table>
          </TableContainer>
        </div>
      </Wrapper>
    );
  }
}

export default Raports;
